  regexp: [
    [/(\d+) requests?/, "$1 次"],
    [
      /Hi, ([^ ]+)! You were last verified as a on (.+). It is not necessary for you to reverify at this time. There may be a wait period between verification and access to academic benefits./,
      (match, user, p1) => {
        const dateRegExp = I18N["zh-CN"]["public"]["time-regexp"];
        const translatedDate = dateRegExp.reduce(
          (acc, [pattern, replacement]) => acc.replace(pattern, replacement),
          p1,
        );
        return (
          `您好，` +
          user +
          `！您最近於${translatedDate}驗證。您現在無需重新驗證。從驗證到享受學業福利之間可能會有一段等待時間。`
        );
        // return '您好，' + user + '！您最近於' + year + '年' + monthKey[month] + day + '日驗證。您現在無需重新驗證。從驗證到享受學業福利之間可能會有一段等待時間。';
      },
    ],
    [
      /Hi, ([^ ]+)! You were last verified as a student on (.+). It is not necessary for you to reverify at this time. There may be a wait period between verification and access to academic benefits./,
      (match, user, p1) => {
        const dateRegExp = I18N["zh-CN"]["public"]["time-regexp"];
        const translatedDate = dateRegExp.reduce(
          (acc, [pattern, replacement]) => acc.replace(pattern, replacement),
          p1,
        );
        return (
          `您好，` +
          user +
          `！您最近於${translatedDate}學生驗證。您現在無需重新驗證。從驗證到享受學業福利之間可能會有一段等待時間。`
        );
        //return '您好，' + user + '！您最近於' + year + '年' + monthKey[month] + day + '日學生驗證。您現在無需重新驗證。從驗證到享受學業福利之間可能會有一段等待時間。';
      },
    ],
    [
      /(Submitted|Verified since) (.+)/,
      (match, opt, p1) => {
        // p1為(.+)
        var optKey = { Submitted: "提交於", "Verified since": "驗證自" };
        const dateRegExp = I18N["zh-CN"]["public"]["time-regexp"];
        const translatedDate = dateRegExp.reduce(
          (acc, [pattern, replacement]) => acc.replace(pattern, replacement),
          p1,
        );
        return optKey[opt] + `${translatedDate}`;
      },
    ],
    //[/Verified since (.+)/, "驗證自 $1"],
    [/(\d+) views?/, "$1 次觀看"],
  ],
